import React from 'react';
import './App.css';

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <h1>視力回復 日めくりカレンダー</h1>
        <img src="https://pbs.twimg.com/media/BkHApMCCUAAyDjz.jpg:large" />
        <p>
        </p>

        <bottun>カレンダーをめくる</bottun>
      </header>
    </div>
  );
}

export default App;
